import Modal from '../../material/modal'
import React, { Component } from 'react';

class LogoutModal extends Component{

    render(){
        return(
            <Modal 
                open={this.props.open} 
                style={{
                    backgroundColor: 'rgba(0, 0, 0, .3)',
                    width: '50%'
                }}
            >
                <h1>Confirm Logout</h1>
            </Modal>
        )
    }

}

export default LogoutModal
